import React, { useState } from "react";

import Box from "@material-ui/core/Box";
import Button from "@material-ui/core/Button";
import Typography from "@material-ui/core/Typography";
import AFastTable from "./aFastTable";
import ATextField from "./aTextField";

const TestContentPanel3 = (props) => {
  const columnDefs = [
    {
      headerName: "ID",
      field: "id",
      sortable: true,
      sortOrder: "asc",
      filter: true,
      checkbox: true,
    },
    { headerName: "Make", field: "make", sortable: true, sortOrder: "desc" },
    { headerName: "Model", field: "model", filter: true },
    { headerName: "Price", field: "price", radio: true },
  ];

  const rowData = [
    { id: 1111, make: "Mock Data", model: "From Prop", price: 1111111 },
    { id: 1231, make: "Toyota", model: "Celica", price: 35000 },
    { id: 1232, make: "Ford", model: " Mondeo", price: 32000 },
    { id: 1233, make: "Porsche", model: "Boxter", price: 35000 },
    { id: 1234, make: "Mercedes Benz", model: "S Class", price: 80000 },
  ];
  return (
    <Box style={{ margin: "20px" }}>
      <ATextField name="search" />{" "}
      <Button variant="contained" color="primary">
        Search
      </Button>
      <AFastTable
        columnDefs={columnDefs}
        rowData={rowData}
        rowSelection="multiple"
        footer={() => {
          return (
            <React.Fragment>
              <Button variant="outlined">&lt;</Button>
              <Button variant="outlined">1</Button>
              <Button variant="outlined">2</Button>
              <Button variant="outlined">3</Button>
              <Button variant="contained">4</Button>
              <Button variant="outlined">5</Button>
              <Button variant="outlined">6</Button>
              <Button variant="outlined">7</Button>
              <Button variant="outlined">8</Button>
              <Button variant="outlined">9</Button>
              <Button variant="outlined">&gt;</Button>
            </React.Fragment>
          );
        }}
      />
    </Box>
  );
};
export default TestContentPanel3;
